import React from 'react'
import { BrowserRouter, Routes, Router } from 'react-router-dom'
import stylesheet from './Pages.module.css'
import Home from './Home/Home'

const Pages = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Router path='/home' element={<Home />} />
            </Routes>
        </BrowserRouter>
    )
}

export default Pages;
